
import java.util.*;

public class Anagram {

    public static void main(String[] args) {
        String s = "";
        String t = "";

        Anagram ana = new Anagram();
        boolean result = ana.isAnagram(s,t);
        System.out.println(result);

    }

    // CONTAINS DUPLICATE LEETCODE
    public boolean isAnagram(String s, String t) {
        if (t.length() != s.length()) {
            return false;
        }

        char[] s1 = s.toCharArray();
        HashMap<Character, Integer> hashmap = new HashMap<Character, Integer>();
        HashMap<Character, Integer> hashmap2 = new HashMap<Character, Integer>();
        for (int i = 0; i<s1.length;i++) {
            if (!hashmap.containsKey(s1[i])) {
                hashmap.put(s1[i], 1);
            } else {
                hashmap.put(s1[i], hashmap.get(s1[i]) + 1);
            }
        }

        //System.out.println(hashmap.toString());

        char[] s2 = t.toCharArray();
        for (int i = 0; i<s2.length;i++) {
            if (!hashmap2.containsKey(s2[i])) {
                hashmap2.put(s2[i], 1);
            } else {
                hashmap2.put(s2[i], hashmap2.get(s2[i]) + 1);
            }
        }

        //System.out.println(hashmap2.toString());
        if (hashmap.size() != hashmap2.size()) return false;

        for (int i = 0; i < s2.length; i++) {
            if (hashmap.containsKey(s2[i])) {
                int length1 = hashmap.get(s2[i]);
                int length2 = hashmap2.get(s2[i]);
                if (length1 != length2) {
                    return false;
                }
            } else {
                return false;
            }
        }

        return true;
    }

}